import React, { useState } from "react";
import styled from "styled-components";
import Draggable from "react-draggable";

const TableImg = styled.img`
  width: 60%;
  height: 60%;
  pointer-events: none;
`;

export default function DraggableTable(props) {
  const [dragging, setDragging] = useState(false);

  return (
    <div className="table-option">
      <Draggable
        onStart={() => setDragging(true)}
        onStop={() => setDragging(false)}
        position={null}
      >
        <div className={`draggable-content ${dragging ? 'dragging' : ''}`}>
          <img className="draggable-icon" src="/assets/icons/draggable-icon.svg" alt="draggable icon" />
          <TableImg src={`/assets/icons/tables/${props.img}`} />
        </div>
      </Draggable>
    </div>
  );
}
